      "desc": "f. Vigésima octava letra del abecedario español, y vigésima quinta del orden latino internacional, que representa un fonema consonántico palatal y sonoro. Su nombre es i griega o ye. En algunas áreas importantes, como el Río de la Plata, se articula generalmente con rehilamiento. Cuando es final de palabra se pronuncia como semivocal; p. ej., en soy, buey. La conjunción y se pronuncia como consonante cuando la palabra anterior termina en vocal y la siguiente empieza también en vocal; p. ej., en este y aquel; representa a la vocal i si está entre consonantes, p. ej., en hombres y mujeres; y adquiere valor de semivocal o semiconsonante cuando forma diptongo con la última vocal de la palabra anterior, p. ej., en yo y tú, o con la primera vocal de la palabra siguiente, p. ej., en parientes y amigos.",
